from sympy import binomial
from sympy.utilities.iterables import partitions
def calc_w(k , m):
    s = 0
    for p in partitions(m, m=k+1):
        fact = 1
        j = k + 1
        for x in p :
            fact *= binomial(j, p[x]) * (x + 1) ** p[x]
            j -= p[x]
        s += fact
    return s
def t_row(n):
    if n == 0 : return [1]
    t = list([0] * n)
    for p in partitions( n):
        fact = 1
        s = 0
        for k in p :
            s += p[k]
            fact *= calc_w(k, p[k])
        if s > 0 :
            t[s - 1] += fact
    for i in range(n - 1):
        t[i + 1] += t[i]
    return [0] + t

